class Solution:
    def isOneEditDistance(self, s: str, t: str) -> bool:
        s_i = 0
        t_i = 0
        distance = 0
        while s_i < len(s) and t_i < len(t) and distance < 2:
            if s[s_i] == t[t_i]:
                # move both indices forward
                s_i += 1
                t_i += 1
            else:
                if s_i + 1 < len(s) and s[s_i + 1] == t[t_i]:
                    # character was removed
                    s_i += 1
                    distance += 1
                elif t_i + 1 < len(t) and t[t_i + 1] == s[s_i]:
                    # character was inserted
                    t_i += 1
                    distance += 1
                else:
                    # character was replaced
                    s_i += 1
                    t_i += 1
                    distance += 1

        # compute remaining distance after comparing all chars before
        s = s[s_i:]
        t = t[t_i:]
        distance += len(s) + len(t)
        return distance == 1


if __name__ == '__main__':
    sol = Solution()

    # are two empty strings valid?
    result = sol.isOneEditDistance('', '')
    assert not result

    result = sol.isOneEditDistance('a', 'bb')
    assert not result

    result = sol.isOneEditDistance('a', '')
    assert result

    result = sol.isOneEditDistance('a', 'ab')
    assert result

    result = sol.isOneEditDistance('a', 'abb')
    assert not result

    result = sol.isOneEditDistance('aa', 'abb')
    assert not result

    result = sol.isOneEditDistance('hello', 'hella')
    assert result

    result = sol.isOneEditDistance('ab', 'acb')
    assert result

    result = sol.isOneEditDistance('cab', 'ad')
    assert not result

    result = sol.isOneEditDistance('a', 'b')
    assert result

    result = sol.isOneEditDistance('benyam', 'ephrem')
    assert not result

    result = sol.isOneEditDistance('1203', '1213')
    assert result

    result = sol.isOneEditDistance(
        '',
        ''
    )
    assert not result

    result = sol.isOneEditDistance(
        '',
        ''
    )
    assert result

    result = sol.isOneEditDistance(
        '',
        ''
    )
    assert not result
